import React from "react";
import { Button } from "react-bootstrap";

const Admin = () => {
	return (
		<Container>
			<Button>Add Type</Button>
			<Button>Add Brand</Button>
			<Button>Add Device</Button>
		</Container>
	);
};

export default Admin;
